import React from 'react';
import OpenAccount from '../OpenAccount';

import Hero from "./Hero.js"
import Brokerage from "./B"

function PricingPage() {
    return ( 
        <div>
            <Hero/>
            <OpenAccount/>
            <Brokerage/>
        </div>
     );
}

export default PricingPage;
